import React,{Component} from 'react';
import logo from '../logo.svg';
import './App.css';
import '../Header/header';
import Header from "../Header/header";
import PeopleService from '../repository/axiospeoplerepository'
import {BrowserRouter as Router,Route} from 'react-router-dom'


class App extends Component{

    constructor(props) {
        super();
        this.state = {
            people: [],
        }
    }



    render(){
        const routing = (
            <div>
                <Router>
                    <Header/>
                </Router>
            </div>
        )
        return (
            <div className={"App"}>
                {routing}
            </div>
        );
    }

}

export default App;
